import React, { Component } from 'react'
import PageNavbar from "./PageNavbar";

export default class Home extends Component {
    render() {
        return (
            <div>
                <PageNavbar active="Home"/>
                <h1>This is Home page</h1>
            </div>
        )
    }
}
